import React from 'react';
import './ProjetoBase.css';

export default function Input(props) {
  const {id, inputName, readOnly} = props;
  return (
    <div className="col">
      <div className="input-field col s8">
        <input type='text' id={id} name={`${inputName}`} readOnly={readOnly} className="materialize-textarea"/>
        <label htmlFor={id}>{`${inputName}`}</label>
      </div>
    </div>
  )
}
